import React, { useState, useEffect } from 'react';
import axios from 'axios';

const DisplayData = () => {
  const [data, setData] = useState([]);
  const [activeLog, setActiveLog] = useState('wp_s3cu_form_on_landing');
  const [page, setPage] = useState(1);

  const fetchNextPage = () => {
    setPage((prevPage) => prevPage + 1);
  }

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(`https://localhost/backend/process_data.php?api=${activeLog}&page=${page}`);
        setData((prevData) => [...prevData, ...Object.values(response.data)]);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, [activeLog, page]);

  const renderHeaders = () => {
    const headers =
      activeLog === "wp_s3cu_form_on_landing"
        ? [
            "ID",
            "Main Point",
            "Sex",
            "Age",
            "Params",
            "Created At",
            "Updated At",
          ]
        : [
            "ID",
            "IP",
            "DateTime",
            "Request Method",
            "URL",
            "Protocol",
            "Status Code",
            "Response Size",
            "Referrer",
            "User Agent",
          ];

    return (
      <thead>
        <tr>
          {headers.map((header, index) => (
            <th key={index}>{header}</th>
          ))}
        </tr>
      </thead>
    );
  };

  return (
    <div>
      <table>
        {renderHeaders()}
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              {Object.values(item).map((value, i) => (
                <td key={i}>{value}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
      <button onClick={fetchNextPage}>Load More</button>
    </div>
  );
};


export default DisplayData;
